description.value:
A set of codes that may have been used by systems in the past that represent:
- Individual vaccination procedure concepts that are no longer active in SNOMED CT but may have been used by IT systems in the past;
- Hierarchies of pre-co-ordinated concepts in SNOMED CT that indicate vaccination procedures that were carried out by another provider, both active and inactive concepts;
- Hierarchies of pre-co-ordinated concepts in SNOMED CT that indicate vaccination procedures that were not done but which were part of the Care Connect Vaccination Procedure ValueSet to support the Digital Child Health Programme to record where a child had attended a vaccination clinic but did not actually receive a vaccination.
Selected from a number of hierarchies and individual concepts within the SNOMED CT UK coding system.
This ValueSet may be used by suppliers to supplement the (preferred) UKCore-VaccinationProcedure ValueSet for the purposes of identifying record entries within systems that may also be relevant to the population of the UKCore-VaccinationProcedure extension within the UKCore-Immunization profile instances.
